import React from 'react';

 import { Container, IconImage } from './styles';
 import {carro}  from '../../../styles/Icons/carro.svg'
function MobileMenu() {
  return(  
            <Container>
              <ul>
                <li>
                  <IconImage src={carro}/>
                  <span>CARROS</span>
                </li>
              </ul>


            </Container>


  );
}

export default MobileMenu;
